B.T_=new A.dq("1) \uc811\uc218 \uc2dc \uc791\uc131\ud55c \uc778\uc801\uc0ac\ud56d \ub4f1 \uac1c\uc778\uc815\ubcf4\ub294 \ubcf8 \uacf5\ubaa8\uc804 \ubaa9\uc801\uc73c\ub85c\ub9cc \uc0ac\uc6a9\ub418\uba70, \uacf5\ubaa8\uc804 \uc885\ub8cc \uc774\ud6c4 1\ub144 \uac04 \ubcf4\uc720 \ubc0f \ud65c\uc6a9\ud558\uace0 \ubcf4\uc720\uae30\uac04 \uacbd\uacfc \uc989\uc2dc \ud30c\uae30\ud569\ub2c8\ub2e4.\n2) 2025 \uc0c1\uc0c1\uc5b4\ubb35 \ucf58\ud14c\uc2a4\ud2b8\ub294 \ucc38\uc5ec \ud69f\uc218 \uc81c\ud55c \uc5c6\uc774 \uc790\uc720\ub86d\uac8c \ucc38\uac00 \uac00\ub2a5\ud558\ub098(3D, \uac8c\uc784 \uc77c\ub7ec\uc2a4\ud2b8\ub808\uc774\uc158, \ubaa8\uc158 \uadf8\ub798\ud53d, AI\ub9cc\ub4e4\uae30 \uc81c\uc678), \uc911\ubcf5 \uc218\uc0c1\uc740 \ubd88\uac00\ud569\ub2c8\ub2e4.\n3) \ucd9c\ud488 \uaddc\uaca9 \ubc0f \uae30\uc900\uc5d0 \ub9de\uc9c0 \uc54a\uac70\ub098, \ud544\uc218 \uc815\ubcf4 \ub204\ub77d \uc2dc \uc2ec\uc0ac\uc5d0\uc11c \uc81c\uc678\ub420 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\n4) \uc811\uc218 \ub9c8\uac10 \uc774\ud6c4 \ucd9c\ud488\uc791 \ubc0f \uac1c\uc778\uc815\ubcf4 \uc218\uc815\uc740 \ubd88\uac00\ub2a5\ud569\ub2c8\ub2e4.\n5) \ucd9c\ud488\uc791 \uc218 \ub610\ub294 \ud004\ub9ac\ud2f0, \uc2ec\uc0ac \uacb0\uacfc\uc5d0 \ub530\ub77c \uc218\uc0c1 \uc791\ud488 \uc218\uac00 \uc870\uc815\ub418\uac70\ub098 \uc218\uc0c1\uc791\uc774 \uc5c6\uc744 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\n6) \ucd5c\uc885 \uc218\uc0c1\uc791 \uc218\uc900, \uc2ec\uc0ac \uacb0\uacfc\uc5d0 \ub530\ub77c \uc2e4\uc81c \ucd9c\uc2dc\uac00 \uc774\ub904\uc9c0\uc9c0 \uc54a\uc744 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\n7) \uc218\uc0c1\uc790\ub294 \ucd5c\ucd08 \uc5f0\ub77d\uc73c\ub85c\ubd80\ud130 7\uc77c \uc774\ub0b4 \ud68c\uc2e0\uc774 \uc5c6\uc744 \uacbd\uc6b0 \uc218\uc0c1\uc774 \ucde8\uc18c\ub420 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\n8) \uc218\uc0c1\uc790\uc758 \uc798\ubabb\ub41c \uc815\ubcf4 \uc785\ub825\uc73c\ub85c \uc778\ud55c \uc5f0\ub77d \ub450\uc808 \ubc0f \ud45c\uc808 \ub4f1\uc758 \uacbd\uc6b0 \uc218\uc0c1 \uacb0\uc815 \ud6c4\uc5d0\ub3c4 \uc218\uc0c1\uc774 \ucde8\uc18c\ub420 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\n9) \ub9cc 14\uc138 \ubbf8\ub9cc \uc544\ub3d9\uc758 \ucf58\ud14c\uc2a4\ud2b8 \ucc38\uc5ec \ubc0f \uc218\uc0c1\uc744 \uc704\ud574 \ud544\uc694\ud55c \uac1c\uc778\uc815\ubcf4 \uc81c\uacf5\uc5d0 \ub300\ud574, \ubcf8\uc778 \ubc0f \ubcf4\ud638\uc790(\ubc95\uc815\ub300\ub9ac\uc778) \ub3d9\uc758 \uc5ec\ubd80 \ud655\uc778 \uc808\ucc28\uac00 \ud544\uc694\ud569\ub2c8\ub2e4.\n10) \uc18c\ub4dd\uc138\ubc95\uc5d0 \ub530\ub77c \uc81c\uc138\uacf5\uacfc\uae08 \ubd80\uc5ec \uacbd\ud488\uc758 \uacbd\uc6b0 \uc81c\uc138\uacf5\uacfc\uae08(2.2%)\uc740 \uace0\uac1d\ubd80\ub2f4\uae08\uc73c\ub85c \ubd80\uacfc\ub418\uba70, \uc2e0\ubd84\uc99d \uc0ac\ubcf8 \ubc0f \ud1b5\uc7a5\uc0ac\ubcf8\uc744 \ud3ec\ud568\ud55c \uac1c\uc778\uc815\ubcf4 \uc81c\uacf5\uc774 \ud544\uc694\ud569\ub2c8\ub2e4. (\uac1c\uc778\uc815\ubcf4 \ubbf8\uc81c\uacf5 \uc2dc \ub2f9\ucca8 \ucde8\uc18c)\n11) \uc720\uc758\uc0ac\ud56d\uc5d0 \uae30\uc7ac\ub418\uc5b4 \uc788\uc9c0 \uc54a\uc740 \uc774\uc678\uc758 \uc0ac\ud56d\uc740 \uc8fc\ucd5c\uc0ac\uc758 \uaddc\uc815\uc5d0 \ub530\ub985\ub2c8\ub2e4.\n",null,B.yt,null,null,null,null,null,null)
